    public function testBerhasilMenyimpanDataContent()
    {
        $url = '/api/contents/create';

        $headers = [
            'Authorization: ' . 'Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiJ9..RcnubOgZq73kb5RHjn9w5eYpbwGdhpRuvS4jXvpFnMOaJLGCKEKs0HDR2S7ZqWQmMR8-6pUSegzoF-5bH0n2mlELssPyAi8IJWap2WqfM65UVneQrXcDxFh9iVTUXGyMtrOeiPx86UH5GjNd_8jXXiJ8OKiAK-Rd7LWQrT4LtaA'
        ];

        $body = [
            "data" => [
                "name" => "background untuk training",
                "lang" => "en",
                "module" => "article",
                "content_body" => [
                    [
                        "value" => "<h4>silahkan untuk menggunakan background seperti gambar di bawah ini</h4> <br> <img src=\"training.jpg\"> <br> <h4> selama mengikuti acara training </h4>",
                        "summary" => "",
                        "format" => "basic_html"
                    ]
                ],
                "content_image" => [
                    [
                        "filename" => "training.jpg",
                        "mimeType" => "image/jpeg",
                        "file" => "data:image/jpeg;base64,"
                    ]
                ],
                "status" => "published",
                "created_date" => "2023-08-09 15:20:43",
                "last_update" => "2023-08-09 20:17:11"
            ],
        ];

        // // Execute cURL session and get response 
        // $response =  $this->http_request($url, $headers); 
        $response = $this->client->request(
            'POST',
            $url,
            [
                'headers' => $headers,
                'json' => $body,
            ]
        );

        // Assert that the response is not null
        $this->assertNotNull($response);

        // Parse JSON response
        $content = $response->toArray();
        $this->assertEquals($content['code'], 0);
    }

